const GastoFormView = ({ monto, concepto, onMontoChange, onConceptoChange, onSubmit }) => (
  <form onSubmit={onSubmit} className="">
    <h2 className="text-2xl font-bold text-center">Registrar Gasto</h2>
    <input
      type="number"
      placeholder="Monto"
      value={monto}
      onChange={onMontoChange}
    />
    <input
      type="text"
      placeholder="Concepto"
      value={concepto}
      onChange={onConceptoChange}
    />
    <button
      type="submit"

    >
      Registrar
    </button>
  </form>
);

export default GastoFormView;
